@RezaNasri1 Either that, or they want to solve the whole “Iran nuclear problem” by bombing Iran’s facilities through Ukraine.
What’s there to lose? Ukraine’s already been hit hard enough.

And the bonus is: this lessens the likelihood of nuclear attack as the war will now be fought in proxy.

@spearfishcabin1 @OAlexanderDK Ukraine, like many other countries has far-right elements.

However, Ukrainian far-right elements don't hold a lot of political power and Russia has a much larger far-right problem than Ukraine.

Also, having a number of political extremists is not a legal reason for an invasion
